const swimmerInlinePng1 = 'url(\'data:image/png;base64,\')';
const swimmerInlinePng2 = 'url(\'data:image/png;base64,\')';
const swimmerInlinePng3 = 'url(\'data:image/png;base64,\')';
const swimmerInlinePng4 = 'url(\'data:image/png;base64,\')';

const swimmerInlinePngs = [
  swimmerInlinePng1,
  swimmerInlinePng2,
  swimmerInlinePng3,
  swimmerInlinePng4,
];

class TelacciSwimmer extends HTMLElement {
  _previousScrollTop = 0;
  _previousDirection = 'upward';
  _scrollingElement = null;

  constructor() {
    super();
    this.attachShadow({mode: 'open'});

    this._scrollingElement = getScrollingElement();

    initSwimmerStyles(this);
    updateSwimmerStylesFromScrollingState(this, this._scrollingElement);

    window.onscroll = (event) => {
      this._swim();
    }
  }

  _swim() {
    updateSwimmerStylesFromScrollingState(this, this._scrollingElement);

    const scrollTop = this._scrollingElement.scrollTop;
    const direction = calculateDirection(scrollTop, this._previousScrollTop);
    if (this._previousDirection !== direction) {
      animateSwimmerDirectionChange(this, direction);
    }
    this._previousDirection = direction;
    this._previousScrollTop = scrollTop;
  }
}

customElements.get('telacci-swimmer') || customElements.define('telacci-swimmer', TelacciSwimmer);

function getScrollingElement() {
  return document.scrollingElement;
}

function initSwimmerStyles(swimmerElement) {
  swimmerElement.style.position = 'fixed';
  swimmerElement.style.top = '0';
  swimmerElement.style.right = '0';
  swimmerElement.style.width = '100px';
  swimmerElement.style.height = '100px';
  swimmerElement.style.backgroundImage = swimmerInlinePng1;
  swimmerElement.style.backgroundSize = '100% auto';
  swimmerElement.style.backgroundPosition = 'center';
  swimmerElement.style.backgroundPosition = 'center';
  swimmerElement.style.backgroundRepeat = 'no-repeat';
}

function updateSwimmerStylesFromScrollingState(swimmerElement, scrollingElement) {
  const scrollTop = scrollingElement.scrollTop;
  const [topPosition, bottomOffset] = calculateSwimmerPositionAndBottomOffset(scrollingElement, swimmerElement);
  const imageIndex = calculateImageIndex(scrollTop, 100, 4);
  setSwimmerStyles(swimmerElement, topPosition, bottomOffset, imageIndex);
  setSwimmerStyleTop(swimmerElement, topPosition, bottomOffset);
}

function calculateSwimmerPositionAndBottomOffset(scrollingElement, swimmerElement) {
  const normalizedTopPosition = calculateNormalizedPosition(scrollingElement, swimmerElement);
  const topPosition = calculateTopPosition(normalizedTopPosition);
  const bottomOffset = calculateBottomOffset(normalizedTopPosition, swimmerElement.clientHeight);
  return [topPosition, bottomOffset];
}

function calculateNormalizedPosition(scrollingElement, swimmerElement) {
  const scrollTop = scrollingElement.scrollTop;
  const clientHeight = scrollingElement.clientHeight;
  const scrollHeight = scrollingElement.scrollHeight;
  if (scrollHeight !== clientHeight) {
    return scrollTop / (scrollHeight - clientHeight);
  }
  return 0;
}

function calculateTopPosition(normalizedTopPosition) {
  return normalizedTopPosition * 100;
}

function calculateBottomOffset(normalizedTopPosition, swimmerHeight) {
  return swimmerHeight * normalizedTopPosition;
}

function generateSwimmerStyleTop(topPosition, bottomOffset) {
  return `calc(${topPosition.toFixed(2)}% - ${bottomOffset.toFixed(2)}px)`;
}

function generateSwimmerStyleBackgroundImage(imageIndex) {
  return swimmerInlinePngs[imageIndex];
}

function setSwimmerStyleTop(swimmerElement, topPosition, bottomOffset) {
  swimmerElement.style.top = generateSwimmerStyleTop(topPosition, bottomOffset);
}

function calculateImageIndex(scrollTop, scrollHeightThreshold, imagesCount) {
  return Math.round(scrollTop / scrollHeightThreshold) % imagesCount;
}

function setSwimmerStyleBackgroundImage(swimmerElement, imageIndex) {
  swimmerElement.style.backgroundImage = generateSwimmerStyleBackgroundImage(imageIndex);
}

function setSwimmerStyles(swimmerElement, topPosition, bottomOffset, imageIndex) {
  setSwimmerStyleTop(swimmerElement, topPosition, bottomOffset);
  setSwimmerStyleBackgroundImage(swimmerElement, imageIndex);
}

function calculateDirection(scrollTop, previousScrollTop) {
  const scrollTopOffset = previousScrollTop - scrollTop;
  return scrollTopOffset > 0 ? 'upward' : 'downward';
}

function animateSwimmerDirectionChange(swimmerElement, direction) {
  const spinUpAnimation = [
    {transform: 'rotate(0)'},
    {transform: 'rotate(180deg)'}
  ];

  const spinDownAnimation = [
    {transform: 'rotate(180deg)'},
    {transform: 'rotate(0)'},
  ];

  const spinTiming = {
    duration: 200,
    iterations: 1,
  }

  if (direction === 'downward') {
    swimmerElement.style.transform = 'rotate(180deg)';
    swimmerElement.animate(spinUpAnimation, spinTiming);
  } else {
    swimmerElement.style.transform = 'rotate(0)';
    swimmerElement.animate(spinDownAnimation, spinTiming);
  }
}
